import React from "react";
import { Link } from "react-router-dom";

class Dashboard extends React.PureComponent {
  render() {
    return (
      <>
        <h2>Dashboard</h2>
        <Link className="p-3 bg-gray-500" to="AddPost">Add Posts</Link>
      </>
    );
  }
}
export default Dashboard;
